import React from "react";
import foodwaste from "../images/foodwaste.jpeg";
import foodwaste2 from "../images/foodwaste2.jpeg";
import contactus from "../images/contactus.jpeg";
function OurMission(props) {
  return (
    <>
      <div className="mission">
        <h1 id="mission1">The food waste movement</h1>
        <h2 id="mission2"> MORE THAN 1/3 OF FOOD IS WASTED</h2>
        &nbsp;&nbsp;&nbsp;
        <img id="mission-img1" src={foodwaste} />
        &nbsp;&nbsp;&nbsp;
        <h3 id="mission3">
          "Reducing food waste is one of the most important things we can do to
          reverse global warming." - Chad Frischmann, Climate Change Expert
        </h3>
        <h1 id="mission4">Our pledge!</h1>
        <img id="mission-img2" src={foodwaste2} />
        &nbsp;&nbsp;&nbsp;
        <button>Find out more</button>
        &nbsp;&nbsp;&nbsp;
        <h3 id="mission3">
          Our mission is to inspire and empower everyone to take action against
          food waste. We know that to live and breathe this every day, we need
          to turn our words into actions. With this in mind we have set out a
          new ambition - to contribute in every way we can to building the
          global food waste movement. It's only when we all come together to
          fight food waste, that we'll be able to generate a positive change in
          society.
        </h3>
        &nbsp;&nbsp;&nbsp;
        <img id="mission-img3" src={contactus} />
        &nbsp;&nbsp;&nbsp;
        <h2 id="mission2">
          If you have any questions about our work then weâ€™d love to hear from
          you.
        </h2>
        &nbsp;&nbsp;&nbsp;
        <button>Contact us</button>
        &nbsp;&nbsp;&nbsp;
      </div>
    </>
  );
}

export default OurMission;
